import React from "react";

export const PlacesContext = React.createContext({
  countries: [],
  cities: [],
  addCity: () => {},
  removeCity: () => {},
});

const PlacesContextProvider = (props) => {
  const addCityHandler = () => {};
  const addCurrentCityHandler = () => {};

  return (
    <PlacesContext.Provider
      value={{
        countries: ["Select Country"],
        cities: ["Select City"],
        addCity: addCityHandler,
        addCurrentCity: addCurrentCityHandler,
      }}
    >
      {props.children}
    </PlacesContext.Provider>
  );
};

export default PlacesContextProvider;
